INSERT INTO `table_event` (`id_event`, `name_event`, `date_event`, `desc_event`, `image_event`) VALUES
(8, 'Evakuasi Ular Hijau di Dalam Bordes Motor', '2025-05-06', 'Dinas pemadam kebakaran dan penyelamtan kota depok UPT Cimanggis mendapatkan laporan via telfon bahwa ada seorang perempuan yang meminta bantuan evakuasi ular yang terdapat pada bordes motor miliknya pada pukul 11:00 WIB. posisi pelapor kebetulan sedang belanja di supermarket yang berlokasi di jln. tugu raya bersebelahan dengan PT. reka karya. mendapat laporan tersebut regu C damkar depok UPT Cimanggis segera menerjunkan 4 personilnya dengan apd lengkap dan alat grabstick untuk menankap ular yang di ketahui berjenis ular hijau. proses evakuasi berhasil dilakukan hanya dalam waktu 10 menit saja.', );
INSERT INTO `table_event` (`id_event`, `name_event`, `date_event`, `desc_event`, `image_event`) VALUES
(9, 'Evakuasi Kucing Terjebak Di dalam Dashboard Mobil', '2025-04-29', 'Seorang pengendara kendaraan roda 4 mendatangi kantor pusat dinas pemadam kebakaran dan penyelamatan kota depok (GDC) pada pukul 16:30 WIB dengan maksud untuk meminta bantuan untuk mengeluarkan seekor kucing yang di ketahui terjebak di dalam dashboard mobilnya. petugas regu B yang sedang piket lantas segera merespon permohonan bantuan tersebut dengan mengerahkan 3 personilnya untuk mengevakuasi kucing yang terjebak tersebut. dengan menggunakan senter dan sarung tangan proses evakuasi berhasil dilakukan untuk mengeluarkan kucing di sela-sela dasboard mobil milik pelapor dalam waktu 10 menit. kucing tersebut terlihat ketakutan namun personil damkar depok berhasil menyelamatkannya.', );
INSERT INTO `table_event` (`id_event`, `name_event`, `date_event`, `desc_event`, `image_event`) VALUES
(10, 'Evakuasi Motor Terjatuh Di Sungai', '2025-04-28', 'Sebuah kejadian tidak terduga di alami 2 orang pemuda yang sedang mengendarai sepeda motor. Tanpa di ketahui penyebabnya motor yang dikendarai mereka lepas kendali dan masuk ke dalam jurang sungai di jalan pitara raya kecamatan pancoran mas kota depok pada pukul 21:15 WIB. menerima laporan dari warga sekitar sebanyak 3 personil tim rescue dari damkar depok pos walikota di turunkan untuk membantu mengevakuasi motor tersebut. Dengan menggunakan tali karmantel dan senter proses evakuasi berhasil di lakukan. Beruntung 2 pengendara motor tersbut selamat dan hanya mengalami luka-luka dan langsung dilarikan ke klinik terdekat.', );
INSERT INTO `table_event` (`id_event`, `name_event`, `date_event`, `desc_event`, `image_event`) VALUES
(11, 'Evakuasi Ular Sanca Di Atas Plafon Rumah Warga', '2025-04-24', 'Dinas pemadam kebakaran dan penyelamatan kota depok (pos walikota) berhasil menangkap dan mengevakuasi seekor ular sanca besar berukuran 2 meter di atas plafon rumah warga yang berlokasi di jln. Letnan hatta sukirman, kelurahan mekarjaya kecamatan sukmajaya kota depok pada pukul 06:10 WIB. Menurut penuturan dari pemilik rumah, bahwa terdengar suara gemuruh di atas plafon rumah miliknya. Di khawatirkan ada hewan buas maka pemilik rumah segera menelfon damkar depok untuk meminta bantuan pengecekan dan setelah menerima laporan tersebut 4 personil dengan APD lengkap dari pos walikota langsung menuju lokasi yang di terima. Benar saja, setelah di lakukan pengecekan ternyata ada seekor ular sanca besar sedang berada di atas plafon rumah tersebut. Dengan cepat tim rescue damkar depok segera menangkap ular tersebur lalu langsung mengevakuasi agar tidak membahayakan pemilik rumah.', );
INSERT INTO `table_event` (`id_event`, `name_event`, `date_event`, `desc_event`, `image_event`) VALUES
(12, 'Evakuasi Kucing Terjebak Di Dalam Saluran Air', '2025-04-21', 'Giat evakuasi penyelamatan seekor kucing yang terjebak didalam gorong-gorong atau saluran air berlokasi di jln. Swadaya raya kelurahan beji kecamatan beji kota depok pada pukul 13:00 WIB oleh regu C pos walikota. Berdasarkan laporan dari warga, kucing tersebut sudah beberapa hari berada didalam saluran air dan tidak bisa keluar kemudian warga sekitar melapor kepada damkar depok untuk meminta bantuan penyelamatan. Sebanyak 3 personil di turunkan untuk melakukan evakuasi dengan mengguanakan APD dan senter. Proses evakuasi memakan waktu selama 30 menit sampai kucing tersebut berhasil di selamatkan.', );
INSERT INTO `table_event` (`id_event`, `name_event`, `date_event`, `desc_event`, `image_event`) VALUES
(13, 'Evakuasi Kucing Terjebak Di Dalam Kap Mesin Mobil', '2025-05-19', 'Evakuasi hewan kucing dilakukan oleh tim rescue dinas pemadam kebakaran dan penyelamatan kota depok UPT tapos yang berjumlah 3 personil pada pukul 07:55 WIB berlokasi di jalan semangka blok S16 No 4 kelurahan sukatani kecamatan tapos kota depok.\r\nMenurut laporan yang di terima, ketika pemilik kendaraan hendak menyalakan mesin mobil terdengar suara kucing di dalam kap mesin mobilnya, khawatir kucing tersebut celaka pemilik kendaraan menelfon damkar depok UPT tapos untuk meminta bantuan evakuasi. Proses evakuasi berjalan lancar dan berhasil mengeluarlan kucing tersebut dalam kondisi selamat.', );

